$templateCache.put("app/inicio/inicio.html","<encabezado></encabezado>\n\n<div class=\"fondo panel panel-primary\">\n    <img class=\"img-responsive\" src=\"../../img/Index.png\" alt=\"Imagen responsive\"></img>\n</div>\n<span id=\"animationSandbox\" class=\"\">\n<h1 class=\"ServiciosL\">Nuestros Servicios</h1>\n</span>\n <section class=\"servicios-laom\">\n        <div class=\"Servicios \">\n            <div class=\"ACitas\">\n            <img class=\"CitassIcon\" src=\"../../img/Citas.png\"></img>\n                <h1 class=\"aCita\">\n                          Agendamiento de Citas\n                </h2>\n                <p class=\"DescripCita\">\n                    Facilitamos la asignación de Citas, para las diferentes consultas y exámenes de fisioterapia que se realizaran en el establecimiento de salud de acuerdo a las necesidades del beneficiario.\n                </p>\n            </div>\n\n\n        <div class=\"Historias-clinicas\">\n            <img class=\"HistoriasIcon\" src=\"../../img/Historias.png\"></img>\n\n                <h1 class=\"HistoCl\">\n                          Manejo de Historias Clinicas\n                </h2>\n                <p class=\"DescripHisto\">\n                    Ofrecemos el manejo de Historias Clínicas de forma comoda. Asegurando confidencialidad y seguridad de datos clínicos al beneficiario. Haciendo que nuestro software sea confiable.\n                </p>\n        </div>\n        </div>\n\n    </section>\n     <hr class=\"featurette-divider\"></hr>\n     <h1 class=\"Contenido-tips\">Tips</h1>\n<section class=\"contenido-principal\">\n    <section class=\"Tips\">\n        <!-- Three columns of text below the carousel -->\n        <div class=\"organizacion otros\">\n            <img class=\"imagen\" src=\"../../img/set1.jpeg\" image width=\"140\" height=\"140\"></img>\n            <div class=\"mostrar\">\n                <h2 class=\"titu\">\n                          No modifiques el yeso\n                          </h2>\n                <p class=\"poner\"> Si bien es aceptable que los amigos y la familia decoren y firmen el yeso, no se debe retirar el revestimiento internode algodón ni quitar partes del yeso. </p>\n            </div>\n        </div>\n        <!-- /.col-lg-4 -->\n\n        <div class=\"organizacion\">\n            <img class=\"imagen\" src=\"../../img/set6.jpg\" width=\"140px\" height=\"140px\"></img>\n            <div class=\"mostrar\">\n                <h2 class=\"titu1\">\n                          Artrosis\n                          </h2>\n                <p class=\"poner\">La artrosis es una patología reumática, el cartílago articular degenera por diversos motivos y aparecen una serie de síntomas tales como dolor y limitación de la amplitud articular que disminuyen la funcionalidad.</p>\n            </div>\n        </div>\n        <!-- /.col-lg-4 -->\n\n\n        <div class=\" organizacion\">\n            <img class=\"imagen\" src=\"../../img/set2.jpg\" width=\"140\" height=\"140\"></img>\n            <div class=\"mostrar\">\n                <h2 class=\"titu2\">\n                          Buena suerte\n                          </h2>\n                <p class=\"poner\">Si tienes alguna fractura lo mejor es guardar reposo y tener paciencia para que el hueso solde adecuadamente, ya que cualquier movimiento en falso hará más lenta tu recuperación.¡Buena suerte!</p>\n            </div>\n        </div>\n        <!-- /.col-lg-4 -->\n\n    </section>\n    <hr class=\"featurette-divider\"></hr>\n <h1 class=\"Contenido-consejos\">Consejos</h1>\n    <section class=\"consejos\">\n\n        <div class=\"organizacion2\">\n            <img class=\"imagenes\" src=\"../../img/set4.jpg\"></img>\n            <div class=\"mostrar2\">\n                <h2 class=\"titu\">Esguince de tobillo</h2>\n                <p class=\"poner2\">\n                    El esguince de tobillo es una de las lesiones más comunes, en el mundo del deporte y en la vida cotidiana, es junto a las lesiones de la espalda una de las patologías que tratamos más a menudo los Fisioterapeutas. En general presenta una buena evolución,\n                    sobre todo si ha sido posible inmovilizar la zona dañada y permitir la movilidad parcial de los territorios sanos, evitar la inmovilización clásica con escayola y permitir que el pie pueda cumplir parte de su función natural va a facilitar\n                    una recuperación acelerada de la patología.\n                </p>\n            </div>\n        </div>\n        <div class=\"organizacion2 otro1\">\n            <img class=\"imagenes2\" src=\"../../img/set3.jpg\"></img>\n            <div class=\"mostrar2\">\n                <h2 class=\"titu\">Centro de gravedad</h2>\n                <p class=\"poner2\">\n                    Desde la física básica y para todo estudio del movimiento en el cuerpo humano bien sea estática o dinámica y de ésta última la cinética y cinemática. Puede definirse como un punto donde se resume todo el peso de un cuerpo (cualquier objeto). Si pudiéramos\n                    comprimir el cuerpo humano desde todas direcciones y reducirlo solo a un punto, este sería el CDG, si una persona tiene una masa de 70kg los 70kg por efecto de la aceleración gravedad produce una fuerza (peso) concentrada en ese punto.\n                </p>\n            </div>\n        </div>\n\n\n        <div class=\"organizacion2 otro\">\n            <img class=\"imagenes\" src=\"../../img/Cuidado.jpg\"></img>\n            <div class=\"mostrar2\">\n                <h2 class=\"titu\">Cuidado de los yesos</h2>\n                <p class=\"poner2\">\n                    Muchos yesos y férulas no son impermeables, por lo tanto, es muy importante conservarlos secos. Cúbrelo con una bolsa plástica o una manga impermeable especial para tomar duchas o baños. Si el yeso se moja, es posible que pierda su resistencia y no sea\n                    capaz de conservar el hueso lesionado en su lugar. Si el yeso o la férula se moja, comuníquese inmediatamente con el médico.\n                </p>\n            </div>\n        </div>\n\n\n\n    </section>\n    <hr class=\"featurette-divider\"></hr>\n\n    <!-- /END THE FEATURETTES -->\n\n\n</section>\n<piepagina></piepagina>\n");
